import { useState } from "react";
export function Moviedatabase() {
    const [Moviedatabase] = useState({
        Movietitle: "check",
        director: "no",
        releaseyear:"c",
        newmovies:"no",
        removemovies:"check"
    })
    return (<div>
        <ul>
            {Object.keys(Moviedatabase).map((key) => {
                return <li>{Moviedatabase[key]}</li>
            })}
        </ul>
    </div>
    )
}
